                subtitle: "expense",
            },
        ],
        topSellingProduct: [
            {
                title: "Wireless Headphone E23",
                description: "Lorem ipsum dolor sit amet consectetur.",
                prevPrice: 500,
                currentPrice: 450,
                imgUrl: "/assets/images/products/headphone-4.jpg",
            },
            {
                title: "Wireless Headphone Y902",
                description: "Lorem ipsum dolor sit amet consectetur.",
                prevPrice: 500,
                currentPrice: 200,
                imgUrl: "/assets/images/products/headphone-3.jpg",
            },
            {
                title: "Wireless Headphone E09",
                description: "Lorem ipsum dolor sit amet consectetur.",
                prevPrice: 500,
                currentPrice: 600,
                imgUrl: "/assets/images/products/headphone-2.jpg",
            },
            {
                title: "Wireless Headphone X89",
                description: "Lorem ipsum dolor sit amet consectetur.",
                prevPrice: 500,
                currentPrice: 350,
                imgUrl: "/assets/images/products/headphone-4.jpg",
            },
        ],
        newUserList: [
            {
                name: "Smith Doe",
                email: "Smith@gmail.com",
                status: "active",
                photoUrl: "/assets/images/faces/1.jpg",
            },
            {
                name: "Jhon Doe",
                email: "Jhon@gmail.com",
                status: "pending",
                photoUrl: "/assets/images/faces/2.jpg",
            },
            {
                name: "Alex",
                email: "Otttio@gmail.com",
                status: "inactive",
                photoUrl: "/assets/images/faces/3.jpg",
            },
            {
                name: "Mathew Doe",
                email: "matheo@gmail.com",
                status: "active",
                photoUrl: "/assets/images/faces/4.jpg",
            },
        ],
        userActivity: [
            {
                activitylist: [
                    {
                        title: "Pages / Visit",
                        count: 2065,
                    },
                    {
                        title: "New user",
                        count: 465,
                    },
                    {
                        title: "Last week",
                        count: 23456,
                    },
                ],
            },
            {
                activitylist: [
                    {
                        title: "Pages / Visit",
                        count: 435,
                    },
                    {
                        title: "New user",
                        count: 5435643,
                    },
                    {
                        title: "Last week",
                        count: 45435,
                    },
                ],
            },
            {
                activitylist: [
                    {
                        title: "Pages / Visit",
                        count: 545,
                    },
                    {
                        title: "New user",
                        count: 54353,
                    },
                    {
                        title: "Last week",
                        count: 4643,
                    },
                ],
            },
        ],
    };

    getUserStatusClass = (status) => {
        switch (status) {
            case "active":
                return "badge-success";
            case "inactive":
                return "badge-warning";
            case "pending":
                return "badge-primary";
            default:
                break;
        }
    };

    render() {
        let {
            cardList1 = [],
            topSellingProduct = [],
            newUserList = [],
            userActivity = [],
        } = this.state;

        return (
            <div>
                {
                /* <Breadcrumb
                    routeSegments={[
                        { name: "Dashboard", path: "/dashboard" },
                        { name: "Version 1" },
                    ]}
                ></Breadcrumb> */}
                <div className="row">
                    <div className="col-lg-3 col-md-6 col-sm-6">
                        <div className="card card-icon-bg card-icon-bg-primary o-hidden mb-4">
                            <div className="card-body text-center row">
                                <div className="col-lg"> imag</div>
                                <div className>
                                    <p>text</p>
                                    <p>text</p>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-6 col-md-6 col-sm-6">
                        <div className="card card-icon-bg card-icon-bg-primary o-hidden mb-4">
                            <div className="card-body text-center">
                                b
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-3 col-md-6 col-sm-6">
                        <div className="card card-icon-bg card-icon-bg-primary o-hidden mb-4">
                            <div className="card-body text-center">
                                c
                            </div>
                        </div>
                    </div>

                </div>

                <div className="row">
                    <div className="col-lg-9 col-md-12">
                        <div className="card mb-4">
                            <div className="card-body p-0">
                                <h5 className="card-title m-0 p-3">Company Calendar</h5>
                                <AppCalendar height="300px"></AppCalendar>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-3 col-md-12">
                        <div className="row">
                            {cardList1.map((card, index) => (
                                <div key={index} className="col-md-6">
                                    <div className="card card-icon-big mb-4">
                                        <div className="card-body text-center">
                                            <i className={card.icon}></i>
                                            <p className="text-muted mt-2 mb-0 text-capitalize">
                                                {card.subtitle}
                                            </p>
                                            <p className="lead text-18 mt-2 mb-0 text-capitalize">
                                                {card.title}
                                            </p>
                                        </div>
                                    </div>
                                </div>
                            ))}
                        </div>
                        <div className="row">
                            <div className="col-md-12">
                                <div className="card card-icon-big mb-4">
                                    <div className="card-body ">
                                        <h4>Quick Links </h4>
                                        <ul>
                                            <li>Add Super Admin</li>
                                            <li>Add Branch</li>
                                            <li> Add Announcement</li>
                                            <li>Add Employee</li>
                                            <li>Generate New Payroll</li>
                                            <li>Add Assets</li>
                                            <li>Add Attendance</li>
                                            <li>New Claims</li>
                                            <li>New Leaves</li>
                                            <li>New Appraisals</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>


                </div>

            </div>
        );
    }
}

export default Dashboard3;
